import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <MantineProvider
        theme={{
          colorScheme: colorScheme,
          primaryColor: 'teal',
        }}
        withGlobalStyles
      >
        <NotificationsProvider>
          <Router>
            <Routes>
              <Route path='/' element={<MainMenu />} />
            </Routes>
          </Router>
        </NotificationsProvider>
      </MantineProvider>
    </div>
  );
}

export default App;
